trailingComments.value:
*
 * 打开客户端 评论详情页（有主楼 并有回复的）
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('open-book-comment-detail', {
 *   params: { messageId: 'd6b81686b25a11e8abc06c92bf28e013' }
 * }).then(function (info) {
 *   lert('[from ready][open-book-comment-detail][then] ' + JSON.stringify(info, null, 2));
 * }).catch(function (err) {
 *   alert('[from ready][open-book-comment-detail][error] ' + JSON.stringify(err, null, 2));
 * });
 *
 *
 * * ios评论详情已测试：评论详情客户端需要使用特定的webview打开，测试时需要改掉url，从书籍封面进入，根据param拼接成url正确即可
 * todo: android的方法根据type不同可打开评论列表和评论详情，未测试
 * ! android桥用于打开详情的功能，在aya项目中只是用来打开作者主页的评论详情
 *

